import React from 'react';

import {ResponsiveContainer,BarChart,Bar,XAxis,YAxis,Tooltip } from "recharts";
import Navbar from './Navbar/Navbar';

const Array =[

    {
        name:"Onion",
        Student:13,
        fees:10000
    },
    {
        name:"Tomato",
        Student:15,
        fees:7000
    },
    {
        name:"Wheat",
        Student:5,
        fees:5000
    },
    {
        name:"Soyabeen",
        Student:13,
        fees:10000
    },
    {
        name:"Cotton",
        Student:10,
        fees:10000
    },
    {
        name:"Maize",
        Student:10,
        fees:6000
    },
    {
        name:"Remain",
        Student:15,
        fees:1000
    }

]



function Data() {
    let max =20;
   
  return (
   
    <div className='barChart'>
        <Navbar/>
 <h1>Crop Data</h1>
    <div className="continer">
    
   
    <ResponsiveContainer width="50%" aspect={1.5} >
        <BarChart data={Array} width={400} height={400}>
            <XAxis dataKey="name" />
            <YAxis dataKey="Student" />
            <Bar dataKey="Student" fill='rebeccapurple'/>
            <Tooltip/>
        </BarChart>
      </ResponsiveContainer>
    
    
    </div>      


    </div>
  )
}

export default Data;
